            title: '% Responded',
            completed: false 
        },
    ]

}

  render() {
    console.log(this.state.lefttab)
    return this.state.lefttab.map((lefttab) =>(
      <div className = 'LeftTab'>
      <button key = {lefttab.id} onClick={Grid}>
        {lefttab.title}
        </button> 
      </div>
    ));    
  }
}

